import { Container, Row, Col,Card } from "react-bootstrap";
import React from "react";

const CartItem = (props) => {
  return (
    <React.Fragment>
      <Container>
        <Row>
          <h4>{props.foodName}</h4>
        </Row>
        <Row>
          <div>
            <button style={{float: 'right', marginLeft:'10px',border: 'none', borderRadius: '5px' , fontSize:'15px', width:'40px',height:'20px', lineHeight:'0px'}}>+</button>
            <button style={{float: 'right', fontSize:'15px',border: 'none', borderRadius: '5px' , width:'40px',height:'20px', lineHeight:'0px'}}>-</button>
          </div>
        </Row>
        <Row>
          <Col>
            <p>{props.price}</p>
          </Col>
          <Col>
            <Card>
              <div>x {props.amount}</div>
            </Card>
          </Col>
        </Row>
      </Container>
    </React.Fragment>
  );
};

export default CartItem;
